INSERT INTO `birds` VALUES (1,'Spanish Eagle','Aquila adalberti','Rare eagle breeding only in Spain and Portugal, with some immatures dispersing into North Africa','https://ebird.org/species/spaeag1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/78539591/1800'),(2,'Red Bird-of-Paradise','Paradisaea rubra','A large bird of lowland forests on the northwest islands. Both sexes have yellow bill, chest and back of the head','https://ebird.org/species/rbopar2','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/274929301/1800'),(3,'Black Bee-eater','Merops gularis','A bee-eater of forest and forest edge that appears entirely black at a distance, but in good light shows a bright red throat and electric blue belly, undertail, and chest spots','https://ebird.org/species/blbeat1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/250959771/1800'),(4,'Cryptic Flycatcher','Ficedula crypta','A small bird of foothill and low-elevation montane forest on Mindanao. Dark brown above with a rufous tail, a white belly, a pale gray chest, and a buffy face and throat','https://ebird.org/species/rutfly7','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/396949101/1800'),(5,'Mindanao Racquet-tail','Prioniturus waterstradti','A medium-sized parrot of montane forest on Mindanao. The two central tail feathers have extended shafts ending in a racket shape','https://ebird.org/species/mirtai1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/372449221/1800'),(6,'Green Thorntail','Discosura conversii','Tiny hummingbird with short straight bill. Male all shimmering green with distinctive, long, pointed tail feathers. Female has short tail and a distinctive white mustache. Both sexes show white band across rump','https://ebird.org/species/gretho1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/41369571/1800'),(7,'Rufous-headed Chachalaca','Ortalis erythroptera','Large chickenlike bird with a long tail. No similar species in limited range; much smaller than Crested Guan and warmer brown than Sickle-winged Guan','https://ebird.org/species/ruhcha1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/203256331/1800'),(8,'Chestnut-backed Owlet','Glaucidium castanotum','Small owl lacking ear tufts, with chestnut mantle and pale belly with streaked flanks. Crepuscular and diurnal, occurring singly or in pairs in wet rainforest, or neighboring woods','https://ebird.org/species/chbowl1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/252001591/1800'),(9,'Little Egret','Egretta garzetta','Small snow-white heron with slender dark bill, blackish legs, and yellowish feet (\"golden slippers\"). Breeding adult has 2 long wispy head plumes and a spray of white plumes (\"aigrettes\") on the lower back','https://ebird.org/species/litegr','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/168489091/1800'),(10,'Lowland Akalat','Sheppardia cyornithopsis','A small shy akalat found in the lower levels of tall forests, often in dark shady areas near water','https://ebird.org/species/lowaka1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/222090081/1800'),(11,'Gray-backed Shrike','Lanius tephronotus','Found in forest edge, farmland, and plains, this adaptable and elegant small shrike is a common sight across much of its range','https://ebird.org/species/gybshr1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/187381131/1800'),(12,'Flame-faced Tanager','Tangara parzudakii','An unmistakable small tanager with bright red-orange face that fades to yellow on the crown and nape. Also note black ear patch, black back, opalescent greenish underparts and shoulder patch, and tawny vent','https://ebird.org/species/flftan1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/244025061/1800'),(13,'Large Frogmouth','Batrachostomus auritus','Sizeable nightbird with deep black eyes and wispy pale whiskers above its eyes that give it the appearance of a distinguished professor. Warm, pale, brown overall with bright white spots on the wings','https://ebird.org/species/larfro1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/236485701/1800'),(14,'Harlequin Duck','Histrionicus histrionicus','Fairly small, boldly patterned diving duck that lives a seemingly dangerous life near fast-moving water and jagged rocks. Male is striking and unmistakable','https://ebird.org/species/harduc','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/63898051/1800'),(15,'White-capped Monarch','Monarcha richardsii','A stunning medium-sized monarch. Glossy purple-black above and on the face and chest, rusty below, with a bluish-gray bill. Conspicuous white on the head extends back into a half-collar','https://ebird.org/species/whcmon1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/385608381/1800'),(16,'Crested Gallito','Rhinocrypta lanceolata','Striking, mostly terrestrial thrush-sized bird of thorn scrub in the Chaco bioregion, from central Argentina to SE Bolivia. Plain grayish-brown plumage with rufous flanks and streaked crest distinctive','https://ebird.org/species/cregal1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/242615471/1800'),(17,'Many-striped Canastero','Asthenes flammulata','Fairly common brownish bird found in shrubby grasslands and páramo in the high Andes from northern Colombia to central Peru','https://ebird.org/species/mascan1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/394710981/1800'),(18,'Black-backed Butcherbird','Cracticus mentalis','Medium-sized black-and-white predator with a white chin. Smaller than Australian Magpie, with a black head and face (remember to check for white chin), black back, black wing tips, and mostly black tail','https://ebird.org/species/blbbut1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/174666121/1800'),(19,'Mbulu White-eye','Zosterops mbuluensis','A small, sharp-billed warbler-like bird with an olive-green back, yellow underparts, and broad white spectacles around the eyes','https://ebird.org/species/brrwhe9','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/257624111/1800'),(20,'Red-billed Quelea','Quelea quelea','A small, short-tailed weaver with a mottled back and a yellow or reddish bill, eye-ring, and legs','https://ebird.org/species/rebque1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/216505401/1800'),(21,'Scott\'s Oriole','Icterus parisorum','This black-and-yellow oriole prefers dry habitats where yuccas are plentiful, often on steep hillsides','https://ebird.org/species/scoori','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/306385361/1800'),(22,'Rose-throated Tanager','Piranga roseogularis','Uncommon in tropical woodland and forest edge of Yucatan Peninsula, mainly at mid-upper levels where often quite and overlooked easily. Usually seen singly or in pairs. Rather plain, despite the name','https://ebird.org/species/rottan1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/150567031/1800'),(23,'Bicolored Antpitta','Grallaria rufocinerea','Medium-sized antpitta that is almost endemic to the Colombian Andes, but barely makes it over the border into Ecuador. It has chestnut upperparts and hood with a gray breast and belly. Sexes look alike','https://ebird.org/species/bicant3','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/207257361/1800'),(24,'Recurve-billed Bushbird','Clytoctantes alixii','Unique, medium-sized antbird with a spectacular heavy and markedly upturned bill. Male is slate gray with a black throat, breast, and tail, and black dotted wings','https://ebird.org/species/rebbus1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/240688161/1800'),(25,'Splendid White-eye','Zosterops luteirostris','Small. Olive-green above and banana-yellow below and on throat. Has a thin white eye-ring and a black patch on the face from the eye forward. Bill and legs orange','https://ebird.org/species/spweye2','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/395703821/1800'),(26,'Temotu Whistler','Pachycephala vanikorensis','A brightly colored bird with a bright golden belly, a black chest band and head, and a clean white throat. Appears to have a black “shawl” with golden wings and a black tail','https://ebird.org/species/temwhi1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/377141461/1800'),(27,'Yellow-footed Flycatcher','Muscicapa sethsmithi','An aptly named flycatcher of the lower parts of the forest edge and forest clearings','https://ebird.org/species/yeffly1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/257629071/1800'),(28,'Kirk\'s White-eye','Zosterops kirki','A small, sharp-billed warbler-like bird. Note the completely yellow underparts and the broad white spectacles around the eye','https://ebird.org/species/kirwhe1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/395663981/1800'),(29,'Cochabamba Mountain Finch','Poospiza garleppi','Large and striking tanager of semi-humid scrubby habitat in hillsides and ravines in the high slopes of the eastern Cordillera of the Andes in central Bolivia','https://ebird.org/species/comfin1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/243817461/1800'),(30,'Cape Sparrow','Passer melanurus','A handsome, unstreaked, brightly colored sparrow with different-looking males and females. The male has a distinctive black head and throat with a striking white crescent extending from the eye around the ear','https://ebird.org/species/capspa1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/211968141/1800'),(31,'Baka Indigobird','Vidua larvaticola','A nest parasite that lays its eggs in the nests of Black-faced Firefinch. Breeding males are glossy black with blue or blue-green iridescence and a pale brownish panel in the wings','https://ebird.org/species/bakind1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/248260971/1800'),(32,'Military Macaw','Ara militaris','Spectacular, huge, and long-tailed parrot, wiped out from most areas by capture for the pet trade. Found very locally in forested foothills, canyons, and adjacent semiopen areas with big trees','https://ebird.org/species/milmac','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/249773351/1800'),(33,'Gray-bellied Spinetail','Synallaxis cinerascens','Small spinetail, which is largely gray-brown overall with rufous wings and tail contrasting with a black throat patch and pale chin','https://ebird.org/species/gybspi1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/95493421/1800'),(34,'Tristan Thrush','Turdus eremita','A robust, variably plumaged dark thrush with orange and buff markings and blotchy brown streaks. Juvenile has buff fringes to its feathers. The only medium-sized songbird within its range','https://ebird.org/species/trithr1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/377060811/1800'),(35,'Variable Oystercatcher','Haematopus unicolor','A large, stocky shorebird endemic to New Zealand. Adults vary in color from all black to pied, with a range of intermediate morphs in between','https://ebird.org/species/varoys1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/110139891/1800'),(36,'Striated Antbird','Drymophila devillei','Streaky long-tailed, slender antbird of bamboo forests. Black-and-white streaked, with an orange-red wash belly and lower back. Longer-tailed than similar warbling-antbirds','https://ebird.org/species/strant2','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/165118031/1800'),(37,'Sahel Bush Sparrow','Gymnoris dentata','A drab sparrow of dry country. Males have a mostly gray head with a rufous eyebrow. Females have a broad pale eyebrow. Both sexes have a white throat. Found in savanna and broadleaf woodland','https://ebird.org/species/buspet1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/248310341/1800'),(38,'Banasura Laughingthrush','Montecincla jerdoni','This is the only montane laughingthrush in its range and hence unmistakable. It is dull brown above, with gray breast and head and a pale rufous belly','https://ebird.org/species/bkclau1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/150494991/1800'),(39,'Chestnut-capped Babbler','Timalia pileata','Distinctive brown babbler with a small black mask, white throat, and rusty orange cap','https://ebird.org/species/chcbab1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/170554661/1800'),(40,'Ashy-bellied White-eye','Zosterops citrinella','Small songbird with bright yellowish upperparts and white “goggles.” Most subspecies have gray underparts; subspecies “unicus” of Sumbawa and Flores has a yellow belly','https://ebird.org/species/asbwhe1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/175195821/1800'),(41,'Manus Cicadabird','Edolisoma admiralitatis','Male is dark slate-gray with a black tail tip, black wing feathers, and a dark blackish mask. Female is gray-capped, cinnamon below with distinct barring, and brownish above','https://ebird.org/species/mancic1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/265188091/1800'),(42,'White-lored Gnatcatcher','Polioptila albiloris','Tiny gray and white bird with cocked tail. Common in tropical dry forest and scrub of Pacific lowlands','https://ebird.org/species/whlgna2','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/41179061/1800'),(43,'Common Murre','Uria aalge','Black-and-white seabird with crisp patterning. Dark brownish-black above with white belly. Head entirely dark in breeding plumage; nonbreeding show white face with curved dark line below eye','https://ebird.org/species/commur','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/302764311/1800'),(44,'Green-billed Coucal','Centropus chlororhynchos','A mid-sized coucal of lowland and mid-hill forest. Black plumage with purplish sheen, dark rufous wings, and pale, greenish bill','https://ebird.org/species/grbcou2','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/252001001/1800'),(45,'Superb Sunbird','Cinnyris superbus','A large, long-billed sunbird in which males and females are very different. Males are dark, with iridescent green upperparts, a bluish-purple throat and breast, and a blood-red belly','https://ebird.org/species/supsun2','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/258304301/1800'),(46,'Naumann\'s Thrush','Turdus naumanni','Paler and more orangish than Dusky Thrush. Adult males are the brightest-colored and young females have patchy black on the throat and chest','https://ebird.org/species/dusthr1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/158688721/1800'),(47,'Monk Parakeet','Myiopsitta monachus','Medium-sized parakeet, bright lime green above with whitish face and chest, pinkish bill, and blue wingtips','https://ebird.org/species/monpar','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/71547631/1800'),(48,'Streaked Saltator','Saltator striatipectus','This grosbeaklike bird is olive above and pale below with a variable amount of dark streaking on the underparts. Also look for a short white eyebrow and a hefty dark bill','https://ebird.org/species/strsal1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/375474731/1800'),(49,'Great-billed Parrot','Tanygnathus megalorynchos','A large green parrot with a massive red bill and prominent yellow markings on the wings. In flight, shows yellow underwings','https://ebird.org/species/grbpar1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/273374681/1800'),(50,'Alagoas Antwren','Myrmotherula snowi','Very rare antwren, unmistakable in its tiny range, likely now restricted to one complex of humid forest fragments in the Brazilian state of Alagoas','https://ebird.org/species/alaant1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/181383871/1800'),(51,'Green-eared Barbet','Psilopogon faiostrictus','Bright leaf-green barbet with a streaked head and a pale yellow-green ear patch. Heavy gunmetal-gray bill is sharp-tipped and brutal-looking','https://ebird.org/species/grebar3','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/221147601/1800'),(52,'Plain Bush-hen','Amaurornis olivacea','A large ground bird of grass, scrub, and forest edge, usually close to water. Slate-gray on the head and underparts, blending to a brown back and tail. Note the greenish-yellow bill and the long yellow legs','https://ebird.org/species/plabuh1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/267261811/1800'),(53,'White-vented Whistler','Pachycephala homeyeri','Warm brown above and white below with a faint cinnamon wash near the “shoulders” that give it a “vested” appearance','https://ebird.org/species/whvwhi1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/237712631/1800'),(54,'Red-throated Barbet','Psilopogon mystacophanos','Large emerald-green barbet with a heavy dark bill. Unlike many barbets, exhibits strong sexual dimorphism: male has yellow, black, blue, and red facial patches, while the female only has blue and red','https://ebird.org/species/retbar1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/221147761/1800'),(55,'African Pied Hornbill','Lophoceros fasciatus','A small hornbill that is frequently encountered as it flies singly or in groups over the canopy, between forest gaps, and over road cuts','https://ebird.org/species/afphor1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/250620941/1800'),(56,'Blue-whiskered Tanager','Tangara johannae','Rare tanager restricted to lowland and foothill rainforest in northwestern Ecuador and western Colombia. Brilliant emerald-green with black face and throat marked with short blue stripes','https://ebird.org/species/blwtan1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/157472511/1800'),(57,'Chestnut-eared Aracari','Pteroglossus castanotis','Medium-sized toucan of tropical rainforest. Distinguished from other aracaris by blue patch of skin around a light eye and a single red band on its yellow belly','https://ebird.org/species/cheara1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/180912321/1800'),(58,'Hermit Warbler','Setophaga occidentalis','Yellow-faced warbler of western coniferous forests. Males are almost entirely yellow-headed with black nape and throat, gray upperparts with white wingbars, and whitish underparts','https://ebird.org/species/herwar','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/297068091/1800'),(59,'Black-crowned Babbler','Sterrhoptilus nigrocapitatus','A fairly small bird of lowland and foothill forest and edge','https://ebird.org/species/blcbab3','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/395222031/1800'),(60,'Red-and-blue Lory','Eos histrio','A striking red and deep purple-blue parrot with a fairly long tail','https://ebird.org/species/rablor1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/273375271/1800'),(61,'Ring-billed Gull','Larus delawarensis','Fairly small gull, common and widespread throughout most of North America. Breeding adults are white-headed with a bold black ring around the bill; nonbreeding adults have smudgy brown markings on the head','https://ebird.org/species/ribgul','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/303369661/1800'),(62,'Southern Rockhopper Penguin','Eudyptes chrysocome','The smallest of the crested penguins. Note the thin yellow eyebrows that, once past the eyes, flare out toward the rear of the head','https://ebird.org/species/rocpen1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/110242041/1800'),(63,'Mantled Hawk','Pseudastur polionotus','Largish hawk with a short tail and very broad wings. White head, belly and tail with a barred black back','https://ebird.org/species/manhaw2','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/211414191/1800'),(64,'Para Foliage-gleaner','Automolus paraensis','Medium-sized and typically noisy foliage-gleaner with an olive-brown back, buff underparts, a white throat, and a rusty tail','https://ebird.org/species/parfog1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/181386331/1800'),(65,'Crested Caracara','Caracara plancus','Large, long-legged raptor of open habitats. Often walks on the ground or perches conspicuously on a fence post or telephone pole. Note dark cap, pale neck, and dark body','https://ebird.org/species/y00678','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/70583361/1800'),(66,'Swainson\'s Flycatcher','Myiarchus swainsoni','Fairly large gray-brown flycatcher with a long hooked bill and a small crest','https://ebird.org/species/swafly1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/95500871/1800'),(67,'Blue-billed Duck','Oxyura australis','Small stiff-tailed diving duck with a relatively slender dished bill. Floats very low in the water, and unlikely to be seen on land. Male has intense chestnut and black plumage, bright blue bill','https://ebird.org/species/blbduc1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/121406311/1800'),(68,'Chilean Flamingo','Phoenicopterus chilensis','Widespread and often numerous; found at shallow lakes and lagoons from the high Andes to Patagonian steppe and even in coastal waters','https://ebird.org/species/chifla1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/116077031/1800'),(69,'Tropical Shearwater','Puffinus bailloni','Small shearwater of the tropical Indian and Pacific Oceans, where it breeds on barren and rocky atolls and islets, venturing offshore to feed','https://ebird.org/species/troshe5','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/250529921/1800'),(70,'Western Spindalis','Spindalis zena','Uncommon in thickets, forest edge, and gardens, where found mainly at fruiting trees and bushes. Usually in pairs or small flocks, and often quite inconspicuous','https://ebird.org/species/wesspi','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/39521721/1800'),(71,'Sinaloa Crow','Corvus sinaloae','Small glossy crow, common in northwest Mexico; endemic. Occurs in towns, villages, rubbish dumps, farmland, and semiopen areas with hedges and taller trees; often near water','https://ebird.org/species/sincro1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/49040471/1800'),(72,'Red-faced Pytilia','Pytilia hypogrammica','An unusual and pretty member of the waxbill family. Shows fine buff barring below, mostly yellow wings, and red on the rump and tail. Males have a red face and females an entirely gray head','https://ebird.org/species/refpyt1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/388170721/1800'),(73,'Hair-crested Drongo','Dicrurus hottentottus','A big, stocky, dark drongo with highly iridescent wings and shiny feathers on breast and back of the neck','https://ebird.org/species/hacdro1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/148941311/1800'),(74,'Brown-capped Redstart','Myioborus brunniceps','Attractive warbler of montane forest in Bolivia and northwestern Argentina. The broken white eye-ring helps distinguish it from other redstarts in Bolivia, and it is the only redstart found in Argentina','https://ebird.org/species/brcred1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/249772991/1800'),(75,'Slaty Finch','Spodiornis rusticus','Small finchlike bird, actually more closely related to tanagers. Male is uniform slaty gray overall with no contrasting plumage features','https://ebird.org/species/slafin1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/245429721/1800'),(76,'White-browed Robin-Chat','Cossypha heuglini','A large robin-chat with striking fiery orange underparts and collar, and a dark mask and crown split by broad white eyebrows. The back and wings are olive-gray','https://ebird.org/species/wbrcha2','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/219810851/1800'),(77,'Mountain Firetail','Oreostruthus fuliginosus','A chunky finch of upper montane forest edge and shrubby borders of subalpine grasslands. Brown head, brown back and wings, and red rump. Male has an orange-yellow bill a