ales and non-breeding males are brown and streaky','https://ebird.org/species/blwbis1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/239360781/1800'),(596,'Southern Hyliota','Hyliota australis','Mid-sized, generic-looking warbler-like bird. Males have a matte black back, a white wing patch, and very pale yellowish underparts. Females are similar, but browner on the back','https://ebird.org/species/souhyl1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/254027441/1800'),(597,'Pere David\'s Tit','Poecile davidi','Like a Marsh Tit with a bright orange belly, this lively social bird is restricted to the mid-altitude mixed forests of central China. Usually moves about at middle levels in pairs or small flocks','https://ebird.org/species/pedtit1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/177983701/1800'),(598,'Buff-throated Purpletuft','Iodopleura pipra','A diminutive, dumpy, long winged, and shorted tail bird of the canopy in humid forests. Mostly dark gray above with a contrasting cinnamon throat. It has a pale band across the rump and a pale scaly belly','https://ebird.org/species/butpur1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/87838301/1800'),(599,'Small Tree-Finch','Camarhynchus parvulus','A small Galápagos finch with a dainty bill. Bill is slightly curved on both upper and lower edges, and longer than it is deep. Male has a black hood, gray-brown upperparts, and a pale belly','https://ebird.org/species/smtfin1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/191566801/1800'),(600,'Redwing','Turdus iliacus','Rather small, attractive thrush with bold whitish eyebrows, a variable orangey patch on each flank, and a yellow bill base. Shows rusty-orange underwings in flight','https://ebird.org/species/redwin','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/261729761/1800'),(601,'Cinnamon Tanager','Schistochlamys ruficapillus','Large tanager with a thick gray bill. Note the black patch in front of the 