ctive honeyeater of open woodland and shrubland in inland eastern Australia, where usually associated with mistletoe','https://ebird.org/species/paihon1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/173647831/1800'),(627,'Philippine Swiftlet','Aerodramus mearnsi','Uncommon dark swiftlet. Endemic to a smattering of the Philippines islands, from Luzon to Mindanao to Palawan','https://ebird.org/species/phiswi1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/354238141/1800'),(628,'Black-capped Lory','Lorius lory','A red parrot with a black cap, moss-green wings, and a short dark tail. Note the red bill with a dark nostril area. In flight, shows red, yellow, and black stripes on underwings','https://ebird.org/species/blclor1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/263731001/1800'),(629,'White-winged Lark','Alauda leucoptera','Handsome lark with flashing white wing patches. Note streaky gray-brown back, white underparts, and warm rufous shoulder; male also has distinct red cap and ear coverts','https://ebird.org/species/whwlar1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/177988641/1800'),(630,'Bornean Whistler','Pachycephala hypoxantha','Unassuming passerine of Borneo’s central highland forests. Dark olive above and yellow below; males average brighter than females. Forages at middle levels in the forest, often joining mixed-species flocks','https://ebird.org/species/borwhi1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/237712391/1800'),(631,'Wattled Starling','Creatophora cinerea','A medium-sized gray-brown starling with dark wings and tail and a whitish rump','https://ebird.org/species/watsta1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/219650081/1800'),(632,'Pampas Pipit','Anthus chacoensis','Heavily streaked pipit of the Pampas bunch grass lands of central Argentina. From other pipits by densely streaked nape and auriculars, and distinctive song, but very similar to Yellowish Pipit','https