tal Cuckoo','Cuculus optatus','Typical gray cuckoo, indistinguishable from Himalayan Cuckoo in the field by plumage. Dark bands on the breast average broader in Oriental','https://ebird.org/species/oricuc2','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/158860131/1800'),(665,'Sapphire-rumped Parrotlet','Touit purpuratus','Small parrot of lowland rainforest and savanna regions; more common in areas with sandy soils, but rarely seen well','https://ebird.org/species/sarpar2','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/177572021/1800'),(666,'Boulder Finch','Idiopsar brachyurus','Gray finch-like bird with an oddly elongated bill. It is only found in boulder fields and other rocky areas of the high Andes, usually above treeline','https://ebird.org/species/shtfin1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/231303751/1800'),(667,'Little Hermit','Phaethornis longuemareus','Tiny, mostly warm brown hummingbird. Note distinctive curved bill; long, white central tail feathers; and dark brown throat','https://ebird.org/species/lither2','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/175479721/1800'),(668,'Red-necked Nightjar','Caprimulgus ruficollis','Resembles Eurasian Nightjar, but larger with a rufous collar and upper breast and lacks the dark “forearms” seen on Eurasian Nightjar. Note the prominent pale tips on the wing coverts','https://ebird.org/species/rennig1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/80524221/1800'),(669,'Blackish Cuckooshrike','Analisoma coerulescens','A medium-sized bird of lowland and foothill forest. Slender, with a medium-length bill and tail. The male is entirely black with some blue gloss on the back and crown','https://ebird.org/species/blacus1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/267024731/1800'),(670,'Congo Peacock','Afropavo congensis','An amazing and distinctive red-throated and green-backed pheasant with different-looking sexes: male is blue-black below with a