ers','https://ebird.org/species/minher1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/188290561/1800'),(1369,'Blue-rumped Manakin','Lepidothrix isidorei','Small manakin found in cloud forest along the east slope of the Andes. Male is black with a white crown and blue rump; rump is paler in the southernmost part of its range','https://ebird.org/species/blrman1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/157474051/1800'),(1370,'Polynesian Swiftlet','Aerodramus leucophaeus','A medium-sized swiftlet with a relatively long forked tail. Mostly brown with very slightly paler brown underparts and a more golden-brown rump. Most common over rocky riverine valleys and humid forests','https://ebird.org/species/polswi1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/360782531/1800'),(1371,'Tawny-breasted Honeyeater','Xanthotis flaviventer','Large honeyeater found in wetter forested habitats in New Guinea and northern Cape York. Dark brown above, paler buff-brown below, with gray neck and face. Black bill fairly long and decurved','https://ebird.org/species/tabhon1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/173647721/1800'),(1372,'Green Shrike-Babbler','Pteruthius xanthochlorus','A small and unobtrusive inhabitant of montane forests. Round-headed and short-billed','https://ebird.org/species/grsbab1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/158864171/1800'),(1373,'Sulphur-breasted Warbler','Phylloscopus ricketti','Small leaf warbler with vivid yellow underparts and greenish upperparts','https://ebird.org/species/subwar3','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/158882181/1800'),(1374,'White-fronted Falconet','Microhierax latifrons','Tiny, compact, black-and-white falcon. Black above, with a white chest and pale orangish belly. Male has a white crown and face; in female, the white is replaced by rusty orange','https://ebird.org/species/whffal1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset