nd-white hornbill with a diagnostic yellow bill that gives it the nickname of “flying banana”','https://ebird.org/species/sybhor1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/220300271/1800'),(1382,'Topknot Pigeon','Lopholaimus antarcticus','A large solid pigeon with a unique waved crest on the back of the head. Almost entirely gray with darker wing feathers. Tail is dark gray with a broad pale band','https://ebird.org/species/toppig1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/122289841/1800'),(1383,'Wayanad Laughingthrush','Pterorhinus delesserti','A shy, medium-large laughingthrush with a black face mask and whitish underparts. It has a dark slaty-gray crown and mantle and chestnut-brown upperparts','https://ebird.org/species/wynlau1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/150493591/1800'),(1384,'Short-crested Monarch','Hypothymis helenae','A fairly small bird of lowland and foothill forest understory. Male has deep-blue upperparts, head, and chest and a white belly','https://ebird.org/species/shcmon1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/379463541/1800'),(1385,'Loango Weaver','Ploceus subpersonatus','A wetland weaver with a narrow bill, dull olive upperparts, and yellow-orange underparts','https://ebird.org/species/loawea1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/395619901/1800'),(1386,'Blue-rumped Parrot','Psittinus cyanurus','Large-headed and short-tailed parrot with a comically bulbous bill. Male is green with a bright orange bill and a powder-blue head and rump. Female is brown-headed with a dark bill','https://ebird.org/species/blrpar1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/221912461/1800'),(1387,'White-fronted Plover','Charadrius marginatus','Plain, pale plover that is sandy on the back and white below. Preferred habitat is sandy beach, a habitat not favored by most other shorebirds, though also uses mudflats, riverbanks, and other wetlands','https://ebird.org/species/whfplo1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/219814771/1800'),(1388,'Black Butcherbird','Cracticus quoyi','Medium-sized ambush-hunter with a long gray bill with a dark, hooked tip. Completely black plumage; in some cases immature is brown instead of black. Inhabits denser vegetation of mangroves and rainforest edges','https://ebird.org/species/blabut1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/125702601/1800'),(1389,'Purple Cochoa','Cochoa purpurea','An extremely shy and retiring bird, usually sluggish and difficult to see in well-shaded forests; coloration is unlike that of any typical thrush','https://ebird.org/species/purcoc1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/181341181/1800'),(1390,'Thrush Babbler','Illadopsis turdina','A distinctive, richly colored babbler-like skulker with a rufous spotted breast on otherwise whitish underparts. Geographically upperparts vary from rusty to olivaceous','https://ebird.org/species/thrbab1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/255219471/1800'),(1391,'Brazza\'s Martin','Phedina brazzae','A typical martin with brown upperparts and pale underparts strongly marked with dark streaks. Juvenile is rustier, with a paler chin and throat, and is less boldly streaked below','https://ebird.org/species/bramar1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/386961691/1800'),(1392,'Piratic Flycatcher','Legatus leucophaius','Found in tropical lowlands and foothills, migratory in northern part of its range. Favors forest edges, plantations, and clearings with tall trees','https://ebird.org/species/pirfly1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/242978021/1800'),(1393,'Pale-billed Flowerpecker','Dicaeum erythrorhynchos','A tiny nondescript bird with a pale and bulky curved bill. Endemic to the Indian subcontinent where it can occur in any habitat that is not too dry, too wet, or too high','https://ebird.org/species/pabflo1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/126373401/1800'),(1394,'Hartlaub\'s Duck','Pteronetta hartlaubii','A large, dark chestnut-colored duck found primarily in sheltered fresh and brackish waters in well-wooded areas. In flight, distinctive bright blue upperwings stand out even along shaded creeks and streams','https://ebird.org/species/harduc1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/249477171/1800'),(1395,'Long-tailed Starling','Aplonis magna','A large, common, long-tailed bird from lowland and foothill forest canopy and edge on the Bay islands of New Guinea','https://ebird.org/species/lotsta1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/275461911/1800'),(1396,'Gray-winged Blackbird','Turdus boulboul','A large forest thrush whose name describes its key feature; males are black and females are brown, but both have flashing silvery wings. Bright orange bill and eyering are eye-catching in dark forests','https://ebird.org/species/gywbla1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/171484481/1800'),(1397,'Black Shama','Copsychus cebuensis','A medium-sized, long-tailed bird of lowland forest, bamboo, and scrub on Cebu, where it has a preference for valley bottoms','https://ebird.org/species/blasha1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/396489751/1800'),(1398,'Blue-headed Quail-Dove','Starnoenas cyanocephala','A shy plump dove of forests with closed canopies, open understory, and leaf litter. Typically found on the ground and often in pairs. Takes to flight quickly with loud flapping of wings','https://ebird.org/species/bhqdov1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/106854181/1800'),(1399,'Maquis Canastero','Asthenes heterura','Slender and long-tailed canastero of the high Andes from Cochabamba, Bolivia south to NE Argentina. Prefers scrubby hillsides, ravines, and open Polylepis woodland above treeline','https://ebird.org/species/maqcan1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/242830621/1800'),(1400,'Ruddy Treerunner','Margarornis rubiginosus','This small forest bird is bright rufous overall with an obvious white throat and eyebrow','https://ebird.org/species/rudtre1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/47070601/1800'),(1401,'Chestnut-headed Partridge','Arborophila cambodiana','Shy and secretive small gamebird restricted to the Cardamom range of Cambodia and far eastern Thailand','https://ebird.org/species/chhpar1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/336790411/1800'),(1402,'Black Tern','Chlidonias niger','Small tern with an entirely black body in breeding plumage with silvery wings','https://ebird.org/species/blkter','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/320036271/1800'),(1403,'Olive Sunbird','Cyanomitra olivacea','Large, dark, olive-green sunbird with a long, down-curved bill. Can show yellow tufts on the shoulders, though these are usually hidden. Found in forest and adjacent gardens and lush scrub','https://ebird.org/species/eaosun1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/216716721/1800'),(1404,'Sooty-capped Hermit','Phaethornis augusti','Large, brownish hummingbird with a long tail. Pale gray below with strong facial markings and a contrasting rufous rump; broad white tail feather tips are a key field mark','https://ebird.org/species/socher1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/175481841/1800'),(1405,'Flying Steamer-Duck','Tachyeres patachonicus','A large, heavily built duck that is fairly common along rocky seacoasts and on lakes near the coast; also local and uncommon on larger lakes farther inland','https://ebird.org/species/flystd1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/115694231/1800'),(1406,'Slaty-backed Thrush','Geokichla schistacea','An unmistakable black, white, and gray thrush. Gray upperparts and black head marked with bold white cheek patch and long white eyebrow','https://ebird.org/species/slbthr1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/275463221/1800'),(1407,'Golden-crowned Spadebill','Platyrinchus coronatus','Tiny bird of forest undergrowth, named for exceptionally broad bill (difficult to see). Very small and short-tailed. Brownish-olive above and pale yellowish below, with black pattern on cheek','https://ebird.org/species/gocspa1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/245266001/1800'),(1408,'Mountain Bulbul','Ixos mcclellandii','True to its name, tends to be found in the upper reaches of forested hills and mountains. Olive-green overall, with lighter buffy underparts and a streaky gray throat','https://ebird.org/species/moubul2','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/158865901/1800'),(1409,'White-bellied Whistler','Pachycephala leucogastra','A chunky, thick-billed sparrow-sized songbird. Male is uniform gray above with a black head and a conspicuous white throat patch bordered below by a thick black chest band. Underparts are dull whitish','https://ebird.org/species/whbwhi1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/265983661/1800'),(1410,'Golden Whistler','Pachycephala pectoralis','Compact songbird with short pointed bill. Male olive above, yellow below, with white throat set in black head','https://ebird.org/species/golwhi1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/125786951/1800'),(1411,'Spotted Fantail','Rhipidura perlata','A starburst of vanilla sprinkles across the breast makes this black-and-white fantail unmistakable','https://ebird.org/species/spofan1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/222164361/1800'),(1412,'Peruvian Warbling-Antbird','Hypocnemis peruviana','Small streaked antbird. Black-and-white streaked head and underparts with a bold black eyeline and crown, brown wings and tail, and orange-red wash on the sides','https://ebird.org/species/perwaa1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/165118831/1800'),(1413,'Himalayan Woodpecker','Dendrocopos himalayensis','A relatively large woodpecker with a black back, a white patch on the shoulders, and white spots on the flight feathers. A distinctive black stripe runs around the ears to the base of the bill','https://ebird.org/species/himwoo1','https://cdn.download.ams.birds.cornell.edu/api/v1/asset/161381641/1800');
